import React from "react";
import "./Forecast.css";

class Forecast extends React.Component {
  render() {
    return (
      <div className="forecast__container">

        {this.props.forecastOneDay && <div>OneDay: { this.props.forecastOneDay }</div>}
        {this.props.forecastTwoDay && <div>TwoDay: { this.props.forecastTwoDay }</div>}
        {this.props.forecastThreeDay && <div>ThreeDay: { this.props.forecastThreeDay }</div>}
        {this.props.forecastFourDay && <div>FourDay: { this.props.forecastFourDay }</div>}
        {this.props.forecastFiveDay && <div>FiveDay: { this.props.forecastFiveDay }</div>}
      </div>
    )
  }
}

export default Forecast;
